import React from 'react';
import Layout from '../shared/Layout';

const HomePage: React.FC = () => {
  return (
    <Layout>
      <h1>Welcome to NissGram</h1>
      <p>Explore, share, and connect with friends!</p>
    </Layout>
  );
};

export default HomePage;
